import { Routes, Route, Link } from 'react-router-dom';
import styled from 'styled-components';
import Home from './components/templates/home';
import Issue from './components/templates/issue';
import Profile from './components/templates/profile';
import store from './components/store';

const Header = styled.div`
  display: flex;
  padding: 16px;
  -webkit-box-pack: justify;
  justify-content: space-between;
  -webkit-box-align: center;
  align-items: center;
  width: 100%;
  background: rgb(51, 51, 51);
  color: white;
`;

const Gihtubviewer = styled.h1`
  white-space: nowrap;
  color: white;
`;

const Ulist = styled.ul`
  display: flex;
  width: 100%;
  padding: 0px 32px;

  li {
    margin-right: 16px;
    > a {
      color: white;
      font-size: 1.1rem;
    }
  }
`;

const List = styled.li``;

const Main = styled.div`
  max-width: 896px;
  margin: 0px auto;
  padding: 32px 16px;
`;

const Maincontainer = styled.div`
  padding: 16px;
`;

const Mainlayout = styled.div`
  padding: 16px;
  margin-top: 128px;
`;

const Maintext = styled.h1`
  text-align: center;
`;
function Pullrequest() {
  return (
    <Maincontainer>
      <Mainlayout>
        <Maintext>Pullrequest</Maintext>
      </Mainlayout>
    </Maincontainer>
  );
}

function App() {
  return (
    <div className="App">
      <Header>
        <Link to="/">
          <Gihtubviewer>Github Viewer</Gihtubviewer>
        </Link>
        <Ulist>
          <List>
            <Link to="/issue">Issue</Link>
          </List>
          <List>
            <Link to="/pull-request">Pull Request</Link>
          </List>
        </Ulist>
      </Header>
      <Main>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="profile" element={<Profile />} />
          <Route path="issue" element={<Issue />} />
          <Route path="pull-request" element={<Pullrequest />} />
        </Routes>
      </Main>
    </div>
  );
}

export default App;
